import React from 'react'
import './input.scss'

const Input = ({label, ...rest}) => {
    return (
        <div className="input-wrapper">
            <p className="label">{this.props.label}</p>
            <input className="input" placeholder="form input" {...rest} /> 
        </div>
    )
}

export default Input
